import React from 'react';
import './components.css';

export default class Header extends React.Component{
    render(){
        return(
            <header>
                <table className="contanct-info">
                    <tr>
                        <td colspan='20'><h1 className="name">Thomas Defilippis</h1></td>
                        <td className="email">thomasdefilippis@gmail.com</td>
                    </tr>
                </table>
            </header>
        )
    }
}
